import React from 'react'

const TaskCard = () => {
    return (
        <div
        width= "100%"
            border= "black"
            borderRadius= "15px"             
            pt={10}
            paddingRight={45}
            paddingLeft={45}
            pb={10}
        >
            hola
        </div>
    )
}

export default TaskCard
